std::vector<uint64_t>   makeFib()
{
    std::vector<uint64_t>   ret;
    uint64_t        i = 1, j = 1;
    do {
        ret.push_back(j);
        uint64_t    k   = i + j;
        i   = j;
        j   = k;
    } while(j>=i);
    return ret;
}

const std::vector<uint64_t>&    fibonacci() 
{
    static const std::vector<uint64_t> s_ret = makeFib();
    return s_ret;
}

suite tests = []{
    "pi ref"_test = []{
        Memory      pi(REF, kDigitsPi);
        
        expect(sizeof(kDigitsPi) == pi.bytes());
        expect(kDigitsPi == pi.data());
        expect( 0 == memcmp(pi.data(), kDigitsPi, sizeof(kDigitsPi)));
    };

    "pi copy"_test = []{
        Memory      pi(COPY, kDigitsPi);
        
        expect(sizeof(kDigitsPi) == pi.bytes());
        expect( 0 == memcmp(pi.data(), kDigitsPi, sizeof(kDigitsPi)));
    };
    
    "fibanacci ref"_test = []{
        auto&   data = fibonacci();
    
        Memory      fib(REF, data);
        expect(data.size() * sizeof(uint64_t) == fib.bytes());
        expect(0 == memcmp(data.data(), fib.data(), fib.bytes()));
    };

    "fibanacci copy"_test = []{
        auto&   data = fibonacci();
    
        Memory      fib(COPY, data);
        expect(data.size() * sizeof(uint64_t) == fib.bytes());
        expect(0 == memcmp(data.data(), fib.data(), fib.bytes()));
    };
    
    "fibanacci double"_test = []{
        std::vector<uint64_t> data    = fibonacci();
        
        Memory      fib(COPY, data);
        expect(data.size() * sizeof(uint64_t) == fib.bytes());
        expect(0 == memcmp(data.data(), fib.data(), fib.bytes()));
        
        for(uint64_t& u : data)
            u <<= 1ULL;
        
        expect(0 != memcmp(data.data(), fib.data(), fib.bytes()));
    };
    
    "move ref"_test = []{
        Memory      pi(REF, kDigitsPi);
        Memory      pi2 = std::move(pi);
        
        expect(sizeof(kDigitsPi) == pi2.bytes());
        expect(kDigitsPi == pi2.data());
        expect(0 == memcmp(pi2.data(), kDigitsPi, sizeof(kDigitsPi)));
        expect(0 == pi.bytes());
        expect(nullptr == pi.data());
    };

    "move copy"_test = []{
        Memory      pi(COPY, kDigitsPi);
        Memory      pi2 = std::move(pi);
        
        expect(sizeof(kDigitsPi) == pi2.bytes());
        expect(0 == memcmp(pi2.data(), kDigitsPi, sizeof(kDigitsPi)));
        expect(0 == pi.bytes());
        expect(nullptr == pi.data());
    };
};

